import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Services from './pages/Services';

let dataaa = "";

const Result = () => {
    const [ results, setResults ] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8000/main/last")
        .then(response => {
            console.log("real?");
            console.log(response.data["result"]);
            dataaa = JSON.parse(JSON.stringify(response.data));
            console.log(dataaa);
        });
        return dataaa;
    }, []);

    return (
        <>
            {dataaa}
        </>

    );
}

export default Result;
